                </div>

                <h1 className="px-3 font-semibold">{props.work}</h1>
                <p className="px-3 py-">
                    {props.desc}
                </p>2
                <button className="px-3 font-semibold">
                    Read More
                </button>
            </div>
        </>
    )
}
